import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './styles/index.css';

import Home from './inicioRegistro';
import FormularioDiscapacitados from './RegistroDiscapacitados';
import FormularioAcompanantes from './RegistroAcompanantes';
import FormularioConductores from './RegistroConductores';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/RegistroDiscapacitados" element={<FormularioDiscapacitados />} />
        <Route path="/RegistroAcompanantes" element={<FormularioAcompanantes />} />
        <Route path="/RegistroConductores" element={<FormularioConductores />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>
);
